import pdfkit
from datetime import datetime
import os

def generate_pdf_from_html(request,data,perms,type):
    current_datetime = datetime.now()
    formatted_date_time = current_datetime.strftime("%d-%m-%Y %I:%M%p")
    logo_url   = "data:image/png;base64,"
    mod_logo   = "data:image/png;base64,"
    style = '''<style>
            body {
                font-family: Arial, sans-serif;			
            }
            .main{
                margin: auto;
            }

            .logo{
                
                position: fixed;
                width: 150px;
                right: 0%;
                top: 0%;
                display: flex;
                justify-content: center;
                align-items: center;
            }
            .logo_2{
                position: fixed;
                width: 75px;
                left: 3%;
                top: 0%;
                display: flex;
                justify-content: center;
                align-items: center;
            }
            .logo_3{
                position: fixed;
                width: 90px;
                height: 80px;
                left: 15%;
                top: 0%;
                display: flex;
                justify-content: center;
                align-items: center;
            }
            .logo_3 img{
                width:100%;
                height:100%;

            }
            .logo_2 img{
                width:100%;

            }
            
            .logo img {
                width: 100%;
            }
            
            
            .heading h2 {
                text-align: center;
                color: #077ecf;
                font-weight: 450;
                margin-bottom: -7px;
                font-size: 20px;
            }

            .sub-heading p{
                text-align: center;
                font-weight:500;
                line-height: 8px;

            }
            .time-heading p{
                text-align: center;
                font-weight: 400;

            }
            thead{
                font-size: 10px;
                letter-spacing: 1px;
                font-weight: 100;
            }
            tbody{
                font-size: 10px;
                font-family: Arial, Helvetica, sans-serif;
            }
            thead tr:first-child th {
                background-color: #077ecf;
                color: white;
            }
            
            .table table {
                width: 100%;
                border-collapse: collapse;
                margin-top: 20px;
            }

            .table th, td {
                text-align: left;
                padding: 8px;
            }

            .table th {
                background-color: #f2f2f2;
            }
            tbody tr:nth-child(even) {
                /* background-color: #e71a1a; */
                background-color: #efefef;

            }	
        </style>'''
     
    footer_html = """
        <!DOCTYPE html>
        <html lang="en">
        <head>
            <meta charset="UTF-8">
            <meta name="viewport" content="width=device-width, initial-scale=1.0">
            <title>Footer</title>
        </head>
        <body>
            
            <div class="line" style="text-align: center;font-family: Arial, Helvetica, sans-serif; color: #077ecf;">
                <span>2023 ESSI , Fax: +91 - 11 - 41519898, Email:support@elkostaindia.com</span>
            </div>
            <div class="line" style="text-align: center;font-family: Arial, Helvetica, sans-serif;color: #077ecf;">
                <span>www.elkostaindia.com , 101- Mercantile House, K.G Marg , New Delhi-110001 , Ph: +91 - 11 - 41519899</span>
            </div>
        </body>
        </html>
        """   
    
    if type == "event":
        th = '''
        <tr>
        <th>Image</th>
        <th>Name</th>
        <th>Card</th>
        <th>CPF</th>
        <th>Location</th>
        <th>Date Time</th>
        <th>Department</th>
        <th>Designation</th>
        </tr>
        '''
        table_data = ''' '''
        for i in data:
            table_data += f''' 
            <tr>
                <td><img style="height:50px;width:50px;"  src="data:image/png;base64,{i["employee"]["photo"]}"></td>
                <td>{i["employee"]["name"]}</td>
                <td>{i["card"]["card_number"]}</td>
                <td>{i["employee"]["cpf_no"]}</td>
                <td>{i["reader"]["location"]}</td>
                <td>{i["created_on"]}</td>
                <td>{i["employee"]["department_name"]}</td>
                <td>{i["employee"]["designation"]}</td>
            </tr>'''
    
        header_html = f"""
        <!DOCTYPE html>
        <html>
        <head>
            <meta charset="UTF-8">
            <title>Header</title>
            {style}
        </head>
        <body>
         <div class="logo">
		<img src="{logo_url}" alt="">
        </div>
        <div class="logo_2">
		<img src="{mod_logo}" alt="">
        </div>
        
        <div class="heading">
            <h2>National Defence College ( Gov of India )</h2>
        </div>
        <div class="sub-heading">
            <p>Personal Access Control</p>
        </div>
        <div class="sub-heading">
            <p>{perms["type"]}</p>
        </div>
        <div class="sub-heading">
            <p>Generated on: {formatted_date_time}</p>
        </div>
        <div class="sub-heading">
            <p>Report: From {perms["start_date"]} To {perms["end_date"]} | Report Generated By: {(perms["name"].upper())}</p>
        </div>
        <br>
        </body>
        </html>
        """
        
        html = f'''
            <head>
                {style}
            </head>
            <body>
                    <div class="table">
                        <table>
                            <thead>
                                {th}
                            </thead>
                            <tbody>
                                {table_data}
                            </tbody>
                        </table>
                    </div>
                </div>
            </body>
            </html>
    '''
        
        with open('header.html', 'w') as header_file:
            header_file.write(header_html)
        with open('footer.html', 'w') as footer_file:
            footer_file.write(footer_html)
        options = {
            'header-html': 'header.html',
            'footer-html': 'footer.html',
            'footer-left':'[page]/[topage]',
        }
        try:
            output = pdfkit.from_string(html, False,options=options)
            os.remove('header.html')
            os.remove('footer.html')
            print(f"PDF generated successfully at: output.pdf")
            return output
        except Exception as e:
            print(f"Error generating PDF: {e}")
            return False


